  false,\n\t\"url\": null,\n\t\"notes\": \"To survey the target and non-target mammal
  and bird species of Kiska Island and monitor the effect of the Compound 1080 treatment
  on the respective species. The project was conducted to evaluate Compound 1080 as
  a potential introduced fox eradication tool on Kiska and perhaps other select islands
  within the Aleutian Islands Unit of the Alaska Maritime National Wildlife Refuge.
  Species impacts included seabirds, auklets, and Aleutian Canada goose.\",\n\t\"owner_org\":
